	min = a[0];
	MAX = a[0];
	I = 0;
	flag = 1;
	weight = 0;
	for(i=0;i<y;i++){
		for(;I<(M*flag);I++){
			z = I % N;
			if(min>a[z]) min = a[z];
			if(MAX<a[z]) MAX = a[z];
		}
		flag++;
		weight = weight + MAX - min;
		z = I % N;
		MAX = a[z];
		min = a[z];
	}
	printf("%d\n",weight);
	return 0;
}```

