		} else if (T[i] == 's') {
			ans += R;
			T[i] = 'R';
		} else {
			ans += S;
			T[i] = 'S';
		}
	}
	for (; i < N; i++) {
		if (T[i] == 'r' && T[i-K] != 'P') {
			ans += P;
			T[i] = 'P';
		} else if (T[i] == 's' && T[i-K] != 'R') {
			ans += R;
			T[i] = 'R';
		} else if (T[i] == 'p' && T[i-K] != 'S') {
			ans += S;
			T[i] = 'S';
		}
	}

	printf("%d\n", ans);
	fflush(stdout);
